import React from 'react';
import CardList from './CardList';
import {robot} from './robots';
import SearchBox from './SearchBox';



const App = () => {
    return (
        <div className='tc'>
            <h1>RoboFriends</h1>
            <SearchBox />
            <CardList robots={robot} />
        </div>
    )
}

export default App
